import{_ as e,c as t,o as s,ag as o}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"ROLLBACK","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/ROLLBACK.md","filePath":"docs/7x/ref_guide/sql_commands/ROLLBACK.md"}'),i={name:"docs/7x/ref_guide/sql_commands/ROLLBACK.md"};function n(r,a,c,l,d,h){return s(),t("div",null,a[0]||(a[0]=[o('<h1 id="rollback" tabindex="-1">ROLLBACK <a class="header-anchor" href="#rollback" aria-label="Permalink to &quot;ROLLBACK&quot;">​</a></h1><p>Stops the current transaction.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ROLLBACK [WORK | TRANSACTION] [AND [NO] CHAIN]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>ROLLBACK</code> rolls back the current transaction and causes all the updates made by the transaction to be discarded.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>WORK TRANSACTION : Optional key words. They have no effect.</p><p>AND CHAIN : If <code>AND CHAIN</code> is specified, a new transaction is immediately started with the same transaction characteristics (see <a href="./SET_TRANSACTION.html">SET TRANSACTION</a>) as the just finished one. Otherwise, no new transaction is started.</p><h2 id="notes" tabindex="-1"><a id="section5"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>Use <a href="./COMMIT.html">COMMIT</a> to successfully end the current transaction.</p><p>Issuing <code>ROLLBACK</code> when not inside a transaction block emits a warning and otherwise has no effect. <code>ROLLBACK AND CHAIN</code> outside of a transaction block is an error.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>To discard all changes made in the current transaction:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ROLLBACK;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>The command <code>ROLLBACK</code> conforms to the SQL standard. The form <code>ROLLBACK TRANSACTION</code> is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./BEGIN.html">BEGIN</a>, <a href="./COMMIT.html">COMMIT</a>, <a href="./ROLLBACK_TO_SAVEPOINT.html">ROLLBACK TO SAVEPOINT</a>, <a href="./SAVEPOINT.html">SAVEPOINT</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',20)]))}const u=e(i,[["render",n]]);export{m as __pageData,u as default};
